import React, { Component } from "react"
import Modal from "react-modal"
import Modal3 from "react-bootstrap/Modal"
import Button from "react-bootstrap/Button"
import "bootstrap/dist/css/bootstrap.min.css"





class modal2 extends Component {
    constructor() {
        super();
        this.state = {
            isActive: false
        }
    }

    componentWillMount() {
        Modal.setAppElement('body');
    }

    showModal = () => {
        this.setState({
            isActive: !this.state.isActive
        })
    }


    render() {
        return (
            <div>
                <Button onClick={this.showModal}>open modal</Button>

                <Modal isOpen={this.state.isActive}
                    onRequestClose={this.state.isActive}>


                    <Modal3.Dialog>
                        <Modal3.Header closeButton >
                            <Modal3.Title>Modal title</Modal3.Title>
                        </Modal3.Header>

                        <Modal3.Body>
                            {/* {this.props.contactdetails.map(element =>{
                                <h6 key={element.booking_id}>{element.</h6>
                            })} */}
                            <p>asdaskdasd</p>
                        </Modal3.Body>

                        <Modal3.Footer>
                            <Button variant="secondary" onClick={this.showModal}>Close</Button>
                            
                        </Modal3.Footer>
                    </Modal3.Dialog>

                </Modal>

            </div>

        )
    }
}


export default modal2
